import React, { useState } from 'react';
import element from './components/Books';
import data from './models/books';

const App = (element) => {
  const [books] = useState(data);
  return (
    <div>
      {books.map(book => <Book key ={book.id} book={book}/>)}
    </div>
  )
}

export default App;

